import { Hits } from "react-instantsearch";
import './Results.css';


function Hit({ hit }) {
    return (
      <>
        {hit.coverImage && <img src={hit.coverImage} alt={hit.objectID} className="hit-image" />}
        <a href={hit.objectID}>{hit.title}</a>  
        <p>{hit.author}</p>
        </>
    );
  }


function Results() {
    return (
        <Hits 
            hitComponent={Hit} 
            classNames={{
                root: 'MyCustomHits',
                list: 'MyCustomHitsList MyCustomHitsList--subclass',
            }} 
        />
    );
    }

export default Results;
